import React from "react";

export default class Creditos extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col my-5 py-5">
              <h1 className="text-center text-white">Créditos</h1>
              <br/>
              <h5 className="text-center text-white">Julián Baldovino<br/>
                  Willian Orozco<br/>
                  Darcy Castaño<br/>
                  Mariana Muñoz
              </h5>
          </div>
        </div>
      </div>
    );
  }
}
